;////////////////////////////////////////////////////////////////////////////////
; Type: Instrument interface. 
; Note: [Tab] key is NOT allow in editing except remarks(;).
;////////////////////////////////////////////////////////////////////////////////

;********************************************************************************
;Interface setting
;
;********************************************************************************

;Interface setting.
;1.autostart	: Y-Auto start by Service Manager, N-Manual start by Control Manager.
;2.reset	: Time in 24Hr. Reset interface operation. Eg: 00:30
;3.instid	: Instituition ID used by transporter for distribution of messages.
;4.send_app..   : Sending application ID at MSH segment.
;5.send_faci..  : Sending facility ID at MSH segment.
;6.rec.._app..  : Receiving application ID at MSH segment. 
;7.rec.._faci.. : Receiving facility ID at MSH segment.

[interface]
autostart=N
reset=00:30
instid=MASTER
send_application=HCLAB
send_facility=
receive_application=HIS
receive_facility=
connection=T
site_id=


;Sequence no for result file.
;1.length	: The number of digit. eg. Length is 8, this mean 00000001 to 99999999.
;2.sequence_*	: Sequence number which the max value is depend on Length.
[sequence]
length=8
inbox=1
outbox=1


;Process of messages.
;1. batch	: Number of files or records to be process per cycle.
;2. interval	: Time interval between cycle in second.
[queue]
batch=10
interval=2


;Code mapping option.
;1. test_code_mapping	: Enable or disable test code mapping between host and hclab.
;2. code_translation	: Enable or disable other code translation between host and hclab.
[code_mapping]
test_code_mapping=N
code_translation=Y



;********************************************************************************
;Communication Protocol
;
;********************************************************************************
[tcp]
host=127.0.0.1
port=8000
type=C
batch_mode=N


[frame]
frametype=15


;Pending Message Acknowledgement 
;1. enable	: Y = Enable, N=Disable.
;1. batch	: Number of pending message file per cycle.
;2. interval	: Time interval between cycle in second.

[pending]
enable=N
batch=10
interval=3
retry=10


[multiple_channel]
primary_interface=



